import { useForm } from 'react-hook-form';
import { AxiosRequestConfig } from 'axios';
import { requestBackend } from 'util/requests';
import { Users } from 'util/users';

import './styles.css';

type Props = {
  onInsertUser: (permission: Users) => void;
};

type FormData = {
  login: string;
  password: string;
  email: string;
  active: boolean;
};

const UsersForm = ({ onInsertUser }: Props) => {
  const { register, handleSubmit, setValue } = useForm<FormData>();

  const onSubmit = (formdata: FormData) => {
    const params: AxiosRequestConfig = {
      method: 'POST',
      url: '/users/CAC3942E-A7F4-44EB-B24C-8B299C5079A3/permission-group',
      data: formdata,
      withCredentials: true,
    };

    requestBackend(params)
      .then((response) => {
        setValue('login', '');
        setValue('password', '');
        setValue('email', '');
        onInsertUser(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div className="users-form-crud-container">
      <h1>Usuários</h1>
      <form onSubmit={handleSubmit(onsubmit)}>
        <label>Código</label>
        <input type="text" />
        <label>Ativo</label>
        <select name="" id=""></select>
        <label>Login</label>
        <input {...register('login')} name="login" type="text" />
        <label>Senha</label>
        <input {...register('password')} name="password" type="text" />
        <label>Email</label>
        <input {...register('email')} name="email" type="text" />
        <button className="btn btn-primary">SALVAR</button>
        <button className="btn btn-primary">CANCELAR</button>
      </form>
    </div>
  );
};

export default UsersForm;
